import React, { useEffect } from "react";
import { APIProvider, Map } from "@vis.gl/react-google-maps";

export default function LocationsMap() {
  useEffect(() => {
    const loadMap = async () => {
      // Import the required Google Maps libraries
      const { ColorScheme } = await window.google.maps.importLibrary("core");

      // Get the map element and apply the dark color scheme
      const map = new window.google.maps.Map(document.getElementById("map"), {
        center: { lat: 51.0443583, lng: 16.8675189 },
        zoom: 13,
        disableDefaultUI: true,
        mapId: "65ca8f0d0ef266e",
        colorScheme: ColorScheme.DARK, // Apply dark color scheme
      });
    };

    if (window.google) {
      loadMap();
    } else {
      window.initMap = loadMap;
    }
  }, []);

  return (
    <APIProvider apiKey={"AIzaSyBLzOyErw_GGeOYghEGKdDdV8Wyfx7kTpw"}>
      <div id="map" style={{ width: "100%", height: "500px" }}></div>
    </APIProvider>
  );
}
